// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "./ownable.sol";
import "./DateTime.sol";

contract Verify is ownable {
  //長照小卡相關
 struct VerifyCard {
    uint16 ExpiredYear; //有效期限年
    uint8 ExpiredMonth; //有效期限月
    uint8 ExpiredDay; //有效期限日
    string IfOK; //是否合法(還在有效期限內)
    address CardOwner; //小卡持有人
    string OnerCategory;//小卡持有人類別(社工、照服員...)
    string OwnerName;//長照人員名字
  }
  mapping(uint256 => address) public VcontactToOwner;
  mapping(address => uint256) VownerContactCount;
  VerifyCard[] public verifycards;

  //長照小卡總張數
  function verifycardsArrayLength() public view returns (uint count) {
    return verifycards.length;
  }

  //分享驗證碼相關
  
  struct codeInfo{
    address account;//帳戶地址
    // uint256 cIndex;//證書位置
    uint256 createDate;//創建日期
    bool enable;//是否啟用
  }
  mapping(bytes32 => codeInfo) public code;

  //產生驗證碼
  function generateCode(address account) public view returns(bytes32){
    bytes32 hash = keccak256(abi.encodePacked(account, block.timestamp));
    return hash;
  }

  //將新驗證碼加入區塊鏈
  function addCode(
    bytes32 hash,
    address account
  )public{
    code[hash] = codeInfo({
      account: account,
      createDate: block.timestamp,
      enable: true
    });
  }

  //分享的驗證碼期限
  function verifyDate(bytes32 hashh) public{
    //驗證碼可用期限
    code[hashh].enable = block.timestamp < code[hashh].createDate + 3 minutes;
  }

  
  //先驗證此人產生小卡 開始
  function VerifyGenerate(uint16 nowTime, uint16 year, uint8 month, uint8 day, uint256 count, address cardOwner, string memory OwnerCategory, string memory OwnerName) public {
    uint256 ifexist = 0;
    for (uint256 i = 0; i < verifycards.length; i++) {
        if(verifycards[i].CardOwner == cardOwner){
            // if (count >= 15 || (DateTime.getYear(block.timestamp)<year)){
            if (nowTime<year){
                verifycards[i].OwnerName = OwnerName;
                verifycards[i].IfOK = unicode"合法";
                verifycards[i].ExpiredYear = year;
                verifycards[i].ExpiredMonth = month;
                verifycards[i].ExpiredDay = day;
                verifycards[i].OnerCategory = OwnerCategory;
            }
            else if(count >= 15){
                verifycards[i].OwnerName = OwnerName;
                verifycards[i].IfOK = unicode"合法";
                verifycards[i].ExpiredYear = year+6;
                verifycards[i].ExpiredMonth = month;
                verifycards[i].ExpiredDay = day;
                verifycards[i].OnerCategory = OwnerCategory;
            }
            else{
                verifycards[i].OwnerName = OwnerName;
                verifycards[i].IfOK = unicode"已過期";
                verifycards[i].ExpiredYear = year;
                verifycards[i].ExpiredMonth = month;
                verifycards[i].ExpiredDay = day;
                verifycards[i].OnerCategory = OwnerCategory;
            }
            ifexist = 1;
        }
    }
    if(ifexist == 0)
    {
        if (count >= 15 || DateTime.getYear(nowTime)<year){
          verifycards.push(VerifyCard((year+6), month, day, unicode"合法", cardOwner, OwnerCategory, OwnerName));
          uint256 id = verifycards.length - 1;
          VcontactToOwner[id] = msg.sender;
          VownerContactCount[msg.sender]++;
        }
        else{
          verifycards.push(VerifyCard(year, month, day, unicode"已過期", cardOwner, OwnerCategory, OwnerName));
          uint256 id = verifycards.length - 1;
          VcontactToOwner[id] = msg.sender;
          VownerContactCount[msg.sender]++;
        }
    }
        
    }
